Tropical geometry is a developing field in mathematics that models algebraic varieties using polyhedral complexes. Tropical curves are of particular interest, with abstract and planar types. In this paper, we focus on genus $1$ planar tropical curves and prove the connectedness of the moduli space of such curves for any degree. We define abstract and planar tropical curves, as well as the moduli space, and discuss degeneration and regeneration maps. We then provide an upper bound for the absolute values of the coordinates of the direction vectors of bounded edges and prove the connectedness of the moduli space in the case of degree $1$ curves. Finally, we define specific types of degeneration and regeneration maps.

